export const styles = theme => ({
    link: {
        color: theme.palette.primary.main,
        fontFamily: theme.font.regular,
        fontSize: "14px",
        textDecoration: "none",
        "&:hover": { textDecoration: "underline" },
    },
    disabled: { color: theme.palette.text.disabled },
});
